INSERT INTO `fact` (`id`, `title`, `img`, `text`, `slider_caption1`, `slider_caption2`) VALUES
(1, 'Интересное о комарах', , '\'&bull; В мире около 2500 видов комаров. <br />\r\n		&bull; Синий цвет отпугивает мух, а комаров привлекает, поэтому они чаще нападают на людей в синей одежде.<br />\r\n		&bull; Кровь сосут только самки комаров – кровяная плазма нужна им для вынашивания потомства. Самцы питаются исключительно нектаром и водой, как бабочки.<br />\r\n		&bull; Если комар голоден, он может преодолеть до 64 километров в поисках пропитания. Запах еды они чуют на расстоянии до 50 метров.<br />\'', 'А вы знали, что любимый цвет комаров синий?', 'Интересеные факты о комарах.');
INSERT INTO `fact` (`id`, `title`, `img`, `text`, `slider_caption1`, `slider_caption2`) VALUES
(2, 'Дорогой город', , 'Швейцарский Цюрих – самый дорогой город в мире для проживания в 2018г.\r\nТаковы результаты исследования Prices and Earnings (“Цены и доходы”), проведённого банком UBS в 77 населённых пунктах в различных странах.\r\nВ Топ-5 наиболее затратных городов планеты также вошли: Женева, Осло, Копенгаген и Нью-Йорк.\r\nТак, уровень ежемесячного дохода семьи из трех человек в Цюрихе, позволяющего обеспечить минимальный набор товаров и услуг (без арендной платы за жилье), составляет 4260 долларов.\r\nВ Женеве для этого потребуется 4165 долларов, в Нью-Йорке – 3673 доллара, в Лондоне (8 место) – 3411 долларов.\r\nРоссийские Санкт-Петербург и Москва заняли в рейтинге 51 и 54 позиции.\r\nМинимальные затраты для проживания в Северной столице в швейцарском банке оценили почти в 2300 долларов в месяц, в Москве – в 2264 доллара.\r\nНаиболее бюджетным оказался египетский Каир – здесь семье из трех человек потребуется всего 1272 доллара...', 'Самый дорогой город на планете', 'Как вы думаете, какой?');
INSERT INTO `fact` (`id`, `title`, `img`, `text`, `slider_caption1`, `slider_caption2`) VALUES
(3, 'Интересные факты о тарантулах', , '\'1. Тарантулы довольно послушны и редко кусают людей. <br />\r\n		2. Тарантулы для защиты используют жгучие волоски.<br />\r\n		3. Падение может закончиться фатально для паука.<br />\r\n		4.  Тарантулы умеют выпускать когти на лапках, подобно кошкам.<br />\r\n		5. Тарантулы способны восстановить утраченные конечности.<br />\'', 'Тарантул может обходиться без пищи 2 года!', 'Стоит ли бояться голодного тарантула?');
INSERT INTO `fact` (`id`, `title`, `img`, `text`, `slider_caption1`, `slider_caption2`) VALUES
(4, 'Животные в космосе', , '19 августа 1960 года в СССР запущен космический корабль «Спутник-5» с живым грузом на борту — собаками Белкой и Стрелкой, 40 мышами и двумя крысами. После этого собаки Белка и Стрелка стали одними из первых животных, совершившими орбитальный космический полёт и вернувшимися на Землю невредимыми.\r\n\r\nПервыми обезьянами, которые смогли выжить во время полета, были макак-резус Эйбл и беличья обезьяна Мисс Бейкер. Все предыдущие космические полеты с обезьянами на борту заканчивались гибелью животных от удушья или отказа парашютной системы.\r\n\r\nИсточник: https://fishki.net/2578628-zhivotnye-kotorye-letali-v-kosmos.html © Fishki.net', 'Это первое животное, попавшее на Луну', 'Кто еще был на Луне?');
INSERT INTO `fact` (`id`, `title`, `img`, `text`, `slider_caption1`, `slider_caption2`) VALUES
(5, 'Самый протяженный город', , 'Как можно узнать из различных рейтингов, название самого длинного города мире — Мехико. \r\nОн является столицей Мексиканских Соединенных Штатов, государства, расположенного в Северной Америке. Мехико — самый длинный город в мире по протяженности. От края до края его длина составляет более двухсот километров. Однако это не единственный его титул. Кроме того, Мехико считается самым высокорасположенным городом на североамериканском континенте. Его высота — 2235 метров выше уровня моря. Мехико — один из крупнейших и наиболее старых городов мира. - Читайте подробнее на FB.ru: http://fb.ru/article/248113/mehiko-samyiy-dlinnyiy-gorod-v-mire', 'Самый протяженный город мира', 'длиною более 200 километров');
INSERT INTO `fact` (`id`, `title`, `img`, `text`, `slider_caption1`, `slider_caption2`) VALUES
(6, 'Алкогольное облако', , 'На расстоянии 26000 световых лет от Земли находится космическая сущность Стрелец В2 -  это газопылевое облако, содержащее много миллиардов литров винилового спирта. \r\nОблако было обнаружено сетью радиотелескопов MERLIN во время изучения области Млечного Пути, называемой W3(OH). Оно имеет форму гигантского моста, накрывающего область формирования новых звезд в нашей галактике, и вращается вокруг центральной звезды по орбите, подобной орбитам планет.\r\n\r\nПодробнее: https://www.newsru.com/world/05apr2006/cloud.html\r\n\r\n\r\n', 'Вы слышали про алкогольное облако?', 'Читайте здесь.');

