(1, 'Флора и фауна', 'Как называются растения сухих мест обитания, способные переносить продолжительную засуху и воздействие высоких температур?', NULL, 'Гигрофиты', 'Ксерофиты', 'Мезофиты', 'В переводе с греческого \'КСЕРОС\' означает сухой. \'ГИГРОС\' - влажный. \'МЕЗОС\' - средний.', 'flora'),
(2, 'Флора и фауна', 'Какое животное зимой впадает в спячку?', NULL, 'Барсук', 'Волк', 'Белка', 'Только ОДИН представитель семейства куньих впадает зимой в спячку.', 'flora'),
(3, 'Вокруг света', 'Самое большое озеро на планете Земля', NULL, 'Озеро Мичиган', 'Озеро Танганьика', 'Каспийское море', 'Самый крупный замкнутый водоем находится на стыке Европы и Азии.', 'around_world'),
(4, 'Флора и фауна', 'Дерево - чемпион Сибири по скорости роста', NULL, 'Тополь', 'Кедр', 'Береза', 'Летом это дерево доставляет неприятности аллергикам.', 'flora'),
(5, 'Флора и фауна', 'Из какого дерева делают спички', NULL, 'Бао-баб', 'Ель', 'Осина', 'В этом дереве мало смолистых веществ', 'flora'),
(6, 'Технический прогресс', 'Каким изобретением прославились братья Люмьер?', NULL, 'Самолет', 'Синематограф', 'Синтезатор', 'Первыми творениями были \"Выход рабочих с фабрики Люмьер\", \"Прибытие поезда на вокзал Ла-Сьота\".', 'progress'),
(7, 'Технический прогресс', 'Как называется двухместный велосипед?', NULL, 'Круизер', 'Дудик', 'Тандем', 'С английского языка tandem переводится \"пара\"', 'progress'),
(8, 'Технический прогресс', 'Метрополитен какого города построен на глубине 70-80 метров и признан самым глубоким в мире?', NULL, 'Нью-Йорк', 'Санкт-Петербург', 'Шанхай', 'В этом городе с большим водным бассейном необводненные грунты находятся в основном на глубине около 70 метров.', 'progress'),
(9, 'Технический прогресс', 'Фотоаппарат с мгновенной печатью снимков называется', NULL, 'Сони', 'Кодак', 'Полароид', 'Название американской компании, занимающейся производством фототехники, солнцезащитных очков и др., стало нарицательным для необычного фотоаппарата', 'progress'),
(10, 'Технический прогресс', 'Кто в 1714г. изобрел ртутный термометр?', NULL, 'Леонардо да Винчи', 'Габриэль Даниэль Фаренгейт', 'Бенджамин Франклин', 'Именем этого изобретателя названа шкала измерения температур', 'progress'),
(11, 'Технический прогресс', 'Какие изобретения созданы Бенджамином Франклином?', NULL, 'Молниеотвод и бифокальные линзы', 'Градусник и спиртовой термометр', 'Микроскоп и телескоп', 'Его портрет изображен на стодолларовой американской купюре. К слову, он никогда не был президентом страны.', 'progress'),
(12, 'Искусство и культура', 'Как называется артист цирка, объявляющий номера?', NULL, 'Шахер-махер', 'Концертмейстер', 'Шпрехшталмейстер', 'Немецкое слово, дословный перевод которого \"говорящий старший конюший\"', 'art'),
(13, 'Искусство и культура', 'Кто изобрел граненый стакан?', NULL, 'Эрнст Иосифович Неизвестный', 'Вера Игнатьевна Мухина', 'Зураб Константинович Церетели', 'Этот скульптур известен созданием памятника \"Рабочий и колхозница\"', 'art'),
(14, 'Искусство и культура', 'Крупнейший художественный музей в мире', NULL, 'Лувр в Париже', 'Прадо в Мадриде', 'Музей Метрополитен в Нью-Йорке', 'Находится в Европе, в нем представлено около 38000 произведений искусства', 'art'),
(15, 'Искусство и культура', 'Какой стиль не является архитектурным стилем эпохи Постмодернизма?', NULL, 'Хай-тек', 'Маньеризм', 'Деконструктивизм', 'Некоторые искусствоведы называют его ранним барокко.', 'art'),
(16, 'Искусство и культура', 'Праздник Пулиаджат в Индонезии ? День совершеннолетия. Вся молодежь, достигшая совершеннолетия, вместо паспорта получает... Что?', NULL, 'Водительское удостоверение', 'Татуировку', 'Школьный аттестат', 'Это не документ', 'art'),
(17, 'Искусство и культура', 'Как называется хранилище картин?', NULL, 'Пинакотека', 'Картотека', 'Музей', 'От греческого pinax - картина и theke - вместилище', 'art'),
(18, 'Искусство и культура', 'Какой вид искусства называют ?застывшей музыкой??', NULL, 'Живопись', 'Архитектуру', 'Фотографию', '\"Звучит триглиф, звучат колонны, свод, и дивный храм как будто весь поет\" (Гете, \"Фауст\")', 'art'),
(19, 'Вокруг света', 'Архипелагом называется', NULL, 'Болотистая местность', 'Горная цепь', 'Группа островов', 'Различают материковые (Новая Земля), коралловые (Маршалловы острова), вулканические (Гавайские острова).', 'around_world');

